class MetaPainterDoubleFlipped extends shapez.ModMetaBuilding {
    constructor() {
        super("painterDoubleFlipped");
    }

    static getAllVariantCombinations() {
        return [
            {
                variant: shapez.defaultBuildingVariant,
                name: "Flipped Double Painter",
                description: "The double painter building, but mirrored",

                regularImageBase64: RESOURCES["painterDoubleFlipped.png"],
                blueprintImageBase64: RESOURCES["painterDoubleFlippedBlueprint.png"],
                tutorialImageBase64: RESOURCES["painterDoubleFlippedBlueprint.png"],
            },
        ];
    }

    getSilhouetteColor() {
        return "#cd9b7d";
    }

    getDimensions() {
        return new shapez.Vector(2,2);
    }

    getAdditionalStatistics(root) {
        const speed = root.hubGoals.getProcessorBaseSpeed(shapez.enumItemProcessorTypes.painterDouble);
        return [[shapez.T.ingame.buildingPlacement.infoTexts.speed, shapez.formatItemsPerSecond(speed)]];
    }

    getIsUnlocked(root) {
        return true//shapez.root.hubGoals.isRewardUnlocked(shapez.enumHubGoalRewards.reward_stacker);
    }

    setupEntityComponents(entity) {
        entity.addComponent(new shapez.ItemProcessorComponent({}));

        entity.addComponent(
            new shapez.ItemEjectorComponent({
                slots: [{ pos: new shapez.Vector(1, 0), direction: shapez.enumDirection.right }],
            })
        );
        entity.addComponent(
            new shapez.ItemAcceptorComponent({
                slots: [
                    {
                        pos: new shapez.Vector(0, 0),
                        direction: shapez.enumDirection.left,
                        filter: "shape",
                    },
                    {
                        pos: new shapez.Vector(0, 1),
                        direction: shapez.enumDirection.top,
                        filter: "color",
                    },
                ],
            })
        );

        if (entity.components.WiredPins) {
            entity.removeComponent(WiredPinsComponent);
        }

        entity.components.ItemAcceptor.setSlots([
            {
                pos: new shapez.Vector(1, 1),
                direction: shapez.enumDirection.right,
                filter: "shape",
            },
            {
                pos: new shapez.Vector(1, 0),
                direction: shapez.enumDirection.right,
                filter: "shape",
            },
            {
                pos: new shapez.Vector(0, 0),
                direction: shapez.enumDirection.top,
                filter: "color",
            },
        ]);

        entity.components.ItemEjector.setSlots([
            { pos: new shapez.Vector(0, 0), direction: shapez.enumDirection.left },
        ]);

        entity.components.ItemProcessor.type = shapez.enumItemProcessorTypes.painterDouble;
        entity.components.ItemProcessor.processingRequirement = null;
        entity.components.ItemProcessor.inputsPerCharge = 3;
    }
}

class Mod extends shapez.Mod {
    init() {
        this.modInterface.registerNewBuilding({
            metaClass: MetaStackerFlipped,
            buildingIconBase64: RESOURCES["stackerFlippedIcon.png"],
        });
        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "secondary",
            metaClass: MetaStackerFlipped,
        });
        this.modInterface.registerNewBuilding({
            metaClass: MetaMixerFlipped,
            buildingIconBase64: RESOURCES["paintMixerFlippedIcon.png"],
        });
        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "secondary",
            metaClass: MetaMixerFlipped,
        });
        this.modInterface.registerNewBuilding({
            metaClass: MetaPainterDoubleFlipped,
            buildingIconBase64: RESOURCES["painterDoubleFlippedIcon.png"],
        });
        this.modInterface.addNewBuildingToToolbar({
            toolbar: "regular",
            location: "secondary",
            metaClass: MetaPainterDoubleFlipped,
        });
    }
}

